import React from "react";
import { connect } from 'react-redux';
import { getCards } from "../../reducers/api-actions";
import { IReducerState } from "../../reducers/reducer";

interface IKanbanProps extends StateProps, DispatchProps {};

class Kanban extends React.Component<IKanbanProps, {}> {
  componentDidMount() {
    getCards();
  }

  render() {
    console.log(this.props.store);

    return (
      <div className={'kanban-container'}>
          KANAB
      </div>
    );
  }
}

const mapStateToProps = (storeState: IReducerState) => ({
  store: storeState
});

const mapDispatchToProps = {};


type StateProps = ReturnType<typeof mapStateToProps>;
type DispatchProps = typeof mapDispatchToProps;

export default connect(mapStateToProps, mapDispatchToProps)(Kanban);
